/*!50003 CREATE*/ /*!50017 DEFINER=`admin_m`@`%`*/ /*!50003 TRIGGER `EvitarPatrociniosDuplicados` BEFORE INSERT ON `Patrocinios` FOR EACH ROW BEGIN
    DECLARE patrocinio_existente INT;
    
    -- Verificar si ya existe un patrocinio para el mismo equipo y patrocinador en el mismo año
    SELECT COUNT(*) INTO patrocinio_existente
    FROM Patrocinios
    WHERE id_equipo = NEW.id_equipo
    AND id_patrocinador = NEW.id_patrocinador
    AND YEAR(fecha_inicio) = YEAR(NEW.fecha_inicio);
    
    -- Si ya existe un patrocinio, lanzar un error
    IF patrocinio_existente > 0 THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Error: Ya existe un patrocinio para este equipo y patrocinador en el mismo año.';
    END IF;
END */;;
DELIMITER ;
