CREATE DEFINER=`admin_m`@`%` FUNCTION `NumeroCarrerasGanadasEnAño`(p_id_piloto INT, p_año INT) RETURNS int
    DETERMINISTIC
BEGIN
    DECLARE victorias INT;
    
    SELECT COUNT(*) INTO victorias
    FROM Resultados_Carreras r
    JOIN Carreras ca ON r.fecha = ca.fecha
    WHERE r.id_piloto = p_id_piloto
    AND YEAR(ca.fecha) = p_año
    AND r.posicion_final = 1;
    
    IF victorias IS NULL THEN
        SET victorias = 0;
    END IF;
    
    RETURN victorias;
END ;;
