CREATE DEFINER=`admin_m`@`%` FUNCTION `NumeroPodiosEnAño`(p_id_piloto INT, p_año INT) RETURNS int
    DETERMINISTIC
BEGIN
    DECLARE podios INT;
    
    SELECT COUNT(*) INTO podios
    FROM Resultados_Carreras r
    JOIN Carreras ca ON DATE(r.fecha) = DATE(ca.fecha)
    WHERE r.id_piloto = p_id_piloto
    AND YEAR(ca.fecha) = p_año
    AND r.posicion_final IN (1, 2, 3);
    
    IF podios IS NULL THEN
        SET podios = 0;
    END IF;
    
    RETURN podios;
END ;;
