CREATE DEFINER=`admin_m`@`%` PROCEDURE `ResultadosCarrerasPilotoEnAño`(IN p_id_piloto INT, IN p_año INT)
BEGIN
    SELECT 
        r.fecha AS fecha_carrera,
        ci.nombre_circuito AS nombre_circuito,
        r.posicion_final,
        r.puntos_obtenidos
    FROM Resultados_Carreras r
    JOIN Carreras ca ON DATE(r.fecha) = DATE(ca.fecha)
    JOIN Circuitos ci ON r.id_circuito = ci.id_circuito
    WHERE r.id_piloto = p_id_piloto
    AND YEAR(ca.fecha) = p_año
    ORDER BY r.fecha;
END ;;
